                var date = "<span class=\"lead-date-format\"> " + moment(moment.utc(data[0].trim()).toDate()).format('DD MMM YYYY') + " </span>";
                var time = "<span class=\"lead-time-format\"> " + moment(moment.utc(data[0].trim()).toDate()).format('HH:mm:ss') + " </span>";
